import React from 'react'
import {CopyToClipboard} from 'react-copy-to-clipboard'
const ResultLink = () => {
  return (
    
    <div className='shorted-container'>
      <div className="shorted-link"></div>
      <CopyToClipboard>
      <button className='copy-btn'>Copy</button>
      </CopyToClipboard>
    </div>
  )
}

export default ResultLink
